import {useEffect, useState} from "react";

function Images() {

    useEffect(() => {
        fetchItems();
    }, []);

    const [images, setimages] = useState([]);

    const fetchItems = async () => {
        const data = await fetch(
            'https://jsonplaceholder.typicode.com/albums/1/images'
        );

        const images = await data.json();
        setimages(images)
    }

    return (
        <div>
            <h1 className="mb-4">Placeholder images</h1>

            <div className="d-flex row col-md-10 mx-auto align-items-center text-center">

                {images.map(image => (
                    <div className="d-flex col-md-3">
                        <span className="">
                            <img className="img-fluid img-thumbnail" href={image.url} src={image.thumbnailUrl} />
                            <p>{image.title}</p>
                        </span>
                    </div>                    
                ))}
            </div>

        </div>
